 * Test protected and package-private field handling.
 */

@Correct(
    name = "With Protected Field",
    author = "challen@illinois.edu",
    version = "2024.4.0",
    focused = true)
public class Question extends Parent {
  public Question(int setValue, int setAnother) {
    super(setValue, setAnother);
  }

  public int getValue() {
    return super.value + super.testing();
  }

  public int getAnother(Parent second) {
    return second.another + second.anotherTest();
  }

  public int getInner(Parent passed) {
    Inner test = new Inner(passed.value);
    return super.inner.value + passed.inner.value + test.value;
  }

  @FixedParameters("*")
  private static final List<Parent> FIXED = List.of(new Parent(10, 8));

  @RandomParameters("*")
  private static Parent randomParent(Random random) {
    return new Parent(random.nextInt(128) + 1, random.nextInt());
  }
}

