import java.util.Objects;

public class Parent {
  protected int value;
  int another;

  protected class Inner {
    public int value;

    protected Inner(int setValue) {
      value = setValue;
    }
  }

  Inner inner;

  public Parent(int setValue, int setAnother) {
    assert setValue > 0;
    value = setValue;
    another = setAnother;
    inner = new Inner(setValue);
  }

  @Override
  public boolean equals(Object o) {
    if (!(o instanceof Parent other)) {
      return false;
    }
    return value == other.value && another == other.another;
  }

  @Override
  public int hashCode() {
    return Objects.hash(value, another);
  }

  protected int testing() {
    return value * 2;
  }

  int anotherTest() {
    return another * 2;
  }

  Inner thirdTest() {
    return inner;
  }
}

